import React from 'react';
import {NavLink} from 'react-router-dom';
import *as ReactBootStrap from "react-bootstrap";
import {Nav, NavDropdown} from "react-bootstrap";
import AboutL from './AboutL';
import {BrowserRouter,Route,Switch,Link} from 'react-router-dom';
import Course2 from './Course2';

const Navbar2=()=>{
    return (
        <>
        <div className="container-fluid nav_bg ">
            <div className="row">
            <Navbar  variant="dark" defaultActiveKey="/home" className="navn" >
    
    <Nav bg='dark' variant="dark" className="mr-auto" defaultActiveKey="/home">
    <NavLink href='./' className='color' ><h5><b>HOME</b></h5></NavLink>
    <NavLink href='./contact' ><h5><b>CONTACT</b></h5></NavLink>
    <NavDropdown title="LANGUAGE" id="basic-nav-dropdown">
        <NavDropdown.Item className='itms' href="/german">German Language</NavDropdown.Item>
        <NavDropdown.Item href="/japan">Japanese Language</NavDropdown.Item>
        <NavDropdown.Item href="/spanish">Spanish Language</NavDropdown.Item>
        <NavDropdown.Item href="/french">French Language</NavDropdown.Item>
        <NavDropdown.Item href="/ielts">IELTS</NavDropdown.Item>
    </NavDropdown>
    <NavLink href="#pricing"><h5><b>JOB OPPORTUNITY</b></h5></NavLink>
    <NavLink href="#pricing"><h5><b>BLOG </b></h5></NavLink>
      
      
   
    </Nav>
    
  </Navbar>
</div>
</div>
</>
    );


};
const Routes = (
  <BrowserRouter>
    <div>
      <switch>
        <Route path='/' component={AboutL} exact={true}/>

      </switch>
    </div>
  </BrowserRouter>
)
export default Navbar2;
export {Routes};
